import { SQLiteDatabase } from 'expo-sqlite';

export const createBizTables = `
        -- users table (user data)
        CREATE TABLE IF NOT EXISTS users (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            user_me TEXT DEFAULT '888',
            user_name TEXT DEFAULT 'Changeme Corp.',
            user_email TEXT DEFAULT 'user@aiautoinvoicing.com',
            user_phone TEXT DEFAULT '1-888-168-5868',
            user_address TEXT DEFAULT '1600 Pennsylvania Avenue, Washington DC',
            user_website TEXT DEFAULT 'https://aiautoinvoicing.github.io',
            user_bank_info TEXT DEFAULT 'TD Bank',
            user_logo TEXT DEFAULT '',
            user_password TEXT DEFAULT '12345678',
            user_status TEXT DEFAULT 'active',
            user_note TEXT DEFAULT 'This is a note for the user.',

            is_locked INTEGER DEFAULT 0,
            is_deleted INTEGER DEFAULT 0,

            created_at TEXT DEFAULT CURRENT_TIMESTAMP,
            updated_at TEXT DEFAULT CURRENT_TIMESTAMP
        );



        -- Create biz table (biz info, user data)
        CREATE TABLE IF NOT EXISTS biz (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            me TEXT DEFAULT 'meme' UNIQUE,
            user_id     INTEGER DEFAULT 1,              -- The owner (freelancer/micro biz user)

            biz_bk      TEXT DEFAULT 'BK.',
            biz_64_square    TEXT DEFAULT "data:image/png;base64,",
            biz_logo    TEXT DEFAULT '',
            biz_logo64  TEXT DEFAULT "data:image/png;base64,",
            biz_name    TEXT DEFAULT 'My Corporation',  -- The owner (freelancer/micro bi user)
            biz_address TEXT DEFAULT '1600 Pennsylvania Ave.,\nWashington DC',  -- The owner (freelancer/micro bi user),
            biz_email   TEXT DEFAULT 'change@me.com',  -- The owner (freelancer/micro bi user),
            biz_phone   TEXT DEFAULT '1-888-168-5868',  -- The owner (freelancer/micro bi user),
            biz_biz_number  TEXT DEFAULT '821235679RC0001',
            biz_tax_id  TEXT DEFAULT '1685868RT001',  -- The owner (freelancer/micro bi user),
            biz_bank_info   TEXT DEFAULT 'TD Bank',  -- The owner (freelancer/micro bi user),
            biz_inv_template_id TEXT DEFAULT 't1',  -- The owner (freelancer/micro bi user),

            biz_currency   TEXT DEFAULT 'USD',     -- deleted
            biz_website     TEXT DEFAULT 'https://www.aibookshub.com',  -- The owner (freelancer/micro bi user),
            biz_status     TEXT DEFAULT 'active',     -- deleted
            biz_description       TEXT DEFAULT 'This is a note for the bissiness.',                          -- Optional detailed description
            biz_note       TEXT DEFAULT 'This is a note for the bissiness.',                          -- Optional detailed description
            biz_payment_term INTEGER DEFAULT 7,

            is_locked INTEGER DEFAULT 0,
            is_deleted INTEGER DEFAULT 0,

            created_at TEXT DEFAULT CURRENT_TIMESTAMP,
            updated_at TEXT DEFAULT CURRENT_TIMESTAMP
        );



                -- Create tax table (biz info, user data)
        CREATE TABLE IF NOT EXISTS tax (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            user_id INTEGER DEFAULT 1,              -- The owner (freelancer/micro biz user)
            biz_id  TEXT DEFAULT '666',  -- The owner (freelancer/micro biz user)

            tax_name TEXT DEFAULT 'HST',  -- The owner (freelancer/micro biz user)
            tax_rate REAL DEFAULT 0.13,
            tax_number TEXT DEFAULT '123456789RT0001',  -- The owner (freelancer/micro biz user),
            tax_type TEXT DEFAULT 'type',  -- The owner (freelancer/micro biz user),
            tax_note TEXT DEFAULT 'Tax note.',  -- The owner (freelancer/micro biz user),
            tax_status TEXT DEFAULT 'active',  -- The owner (freelancer/micro biz user),

            is_locked INTEGER DEFAULT 0,
            is_deleted INTEGER DEFAULT 0,

            created_at TEXT DEFAULT CURRENT_TIMESTAMP,
            updated_at TEXT DEFAULT CURRENT_TIMESTAMP
        );



-- payment method table (biz info, user data)
        CREATE TABLE IF NOT EXISTS payment_methods (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            user_id INTEGER DEFAULT 1,              -- The owner (freelancer/micro biz user)
            biz_id  TEXT DEFAULT '666',  -- The owner (freelancer/micro biz user)

            pm_name TEXT DEFAULT '',  -- The owner (freelancer/micro biz user)
            pm_note TEXT DEFAULT 'Tax note.',  -- The owner (freelancer/micro biz user),

            is_locked INTEGER DEFAULT 0,
            is_deleted INTEGER DEFAULT 0,

            created_at TEXT DEFAULT CURRENT_TIMESTAMP,
            updated_at TEXT DEFAULT CURRENT_TIMESTAMP
        );

        `;


export async function seedUsersBiz(db: SQLiteDatabase) {
    await db.runAsync(`INSERT INTO users DEFAULT VALUES;`);
    await db.runAsync(`INSERT INTO biz DEFAULT VALUES;`);
    await db.runAsync(`
        INSERT INTO tax (user_id, biz_id, tax_name, tax_rate, tax_number, tax_type, tax_note, tax_status) VALUES
            -- Canada
            (1, '666', 'HST', 0.13, '123456789RT0001', 'federal', 'Canada Harmonized Sales Tax', 'active'),
            (1, '666', 'GST', 0.05, '123456789RT0001', 'federal', 'Canada Goods & Services Tax', 'active'),
            (1, '666', 'PST', 0.07, '123456789RT0001', 'provincial', 'Provincial Sales Tax (e.g. BC)', 'active'),
            (1, '666', 'QST', 0.09975, '123456789RT0001', 'provincial', 'Quebec Sales Tax', 'active'),

            -- United States
            (1, '666', 'SST', 0.06, 'US-TAX-001', 'state', 'State Sales Tax (e.g. FL, KY, PA)', 'active'),
            (1, '666', 'CT', 0.01, 'US-TAX-002', 'county', 'County Tax (e.g. LA County, CA)', 'active'),
            (1, '666', 'LST', 0.02, 'US-TAX-003', 'local', 'Local/City Tax (e.g. NYC, Chicago)', 'active'),
            (1, '666', 'DST', 0.005, 'US-TAX-004', 'district', 'District Tax (e.g. LA Transit)', 'active');
        `);

    await db.runAsync(`
        INSERT INTO payment_methods (user_id, biz_id, pm_name, pm_note, is_locked)            VALUES
            (1, '666', 'Credit Card', 'Processed via Stripe or Square.', 0),
            (1, '666', 'Check', 'Make payable to My Business Name.', 0),
            (1, '666', 'Cash', 'Accepted for local transactions only.', 0),
            (1, '666', 'Bank Transfer (ACH)', 'Routing and account number required.', 0),
            (1, '666', 'Wire Transfer', 'International bank wire. Bank fees may apply.', 0),
            (1, '666', 'PayPal', 'Send payments to user@example.com', 0),
            (1, '666', 'Bank Transfer (EFT)', 'Canadian customers only.', 0),
            (1, '666', 'Interac e-Transfer', 'Only available in Canada.', 0),
            (1, '666', 'Other', 'Please refer to the invoice note for payment instructions.', 0)
        `);
}
